//****************************************************************************
// VARIABLE DECLARATIONS
//****************************************************************************

//****************************************************************************
// FUNCTION DECLARATIONS
//****************************************************************************
void OsdFontVLCLoadFont(BYTE ucState);
void OsdFontVLCLoadFontByGen(BYTE *pucArray, WORD usVLCTableSize, BYTE ucBankNum, WORD usOffset, WORD usFontTableStart, EnumOsdRotateType enumOsdRotateType);

//****************************************************************************
// FUNCTION DEFINITIONS
//****************************************************************************
//--------------------------------------------------
// Description  : Osd Load Hardware VLC Font
// Input Value  :
// Output Value :
//--------------------------------------------------
void OsdFontVLCLoadFont(BYTE ucState)
{
    BYTE ucOsdRotateStatus = _OSD_ROTATE_DEGREE_0;
#if((_OSD_ROTATE_FUNCTION == _OSD_ROTATE_SOFTWARE) ||\
    (_OSD_ROTATE_FUNCTION == _OSD_ROTATE_HARDWARE))
    ucOsdRotateStatus = GET_OSD_ROTATE_STATUS();
#endif

    switch(ucState)
    {
        case _FONT1_GLOBAL:
            OsdFontVLCLoadFontByGen(tFONT1_GLOBAL, VLC_TABLE_SIZE(tFONT1_GLOBAL), GET_CURRENT_BANK_NUMBER(), _1GLOBAL_START, g_usFontTableStart, ucOsdRotateStatus);
            break;

        case _REALTEK_LOGO_FONT_CMD:
            UserCommonOsdHardwareVLCCommand(tDRAW_LOGO_MAP_VLC, VLC_TABLE_SIZE(tDRAW_LOGO_MAP_VLC), GET_CURRENT_BANK_NUMBER(), 0, _BURSTWRITE_FROM_FLASH);
            UserCommonOsdHardwareVLCFont(tDRAW_LOGO_FONT_VLC, VLC_TABLE_SIZE(tDRAW_LOGO_FONT_VLC), GET_CURRENT_BANK_NUMBER(), 0, ucOsdRotateStatus, _BURSTWRITE_FROM_FLASH);
            break;

        case _REALTEK_4BIT_LOGO:
            OsdFontVLCLoadFontByGen(tICON_REALTEK_4BIT_LOGO, VLC_TABLE_SIZE(tICON_REALTEK_4BIT_LOGO), GET_CURRENT_BANK_NUMBER(), (_4BIT_ICON_OFFSET + _4BIT_REALTEK_LOGO_ST * 4), g_usFontTableStart, ucOsdRotateStatus);
            break;
#if(_DM_FUNCTION == _ON)
        case _FONT_DVISION:
            OsdFontVLCLoadFontByGen(tFONT_G_VISION, VLC_TABLE_SIZE(tFONT_G_VISION), GET_CURRENT_BANK_NUMBER(), (_1GLOBAL_START), g_usFontTableStart, ucOsdRotateStatus);
            break;
        case _FONT_DVISION_2P:
            OsdFontVLCLoadFontByGen(tFONT_G_VISION, VLC_TABLE_SIZE(tFONT_G_VISION), GET_CURRENT_BANK_NUMBER(), (_OSD_PAGE_2_START), g_usFontTableStart, ucOsdRotateStatus);
            break;
#endif
        case _FONT1_CROSSHAIR:
            OsdFontVLCLoadFontByGen(tFONT1_CROSSHAIR, VLC_TABLE_SIZE(tFONT1_CROSSHAIR), GET_CURRENT_BANK_NUMBER(), _1GLOBAL_START, g_usFontTableStart, ucOsdRotateStatus);
            break;

        default:
            break;
    }
}

//--------------------------------------------------
// Description  : Osd Load Hardware VLC
// Input Value  : *pArray          -> VLC table
//                usVLCTableSize   -> Use VLC_TABLE_SIZE(VLC table)
//                ucBankNum        -> Bank number (GET_CURRENT_BANK_NUMBER())
//                usOffset         -> Font address
//                usFontTableStart -> Font base address
//                ucOsdRotateType  -> _OSD_ROTATE_DEGREE_0 or _OSD_ROTATE_DEGREE_90 or _OSD_ROTATE_DEGREE_270 or _OSD_ROTATE_DEGREE_180
// Output Value :
//--------------------------------------------------
void OsdFontVLCLoadFontByGen(BYTE *pucArray, WORD usVLCTableSize, BYTE ucBankNum, WORD usOffset, WORD usFontTableStart, EnumOsdRotateType enumOsdRotateType)
{
    usFontTableStart = usFontTableStart;
    UserCommonOsdHardwareVLCFont(pucArray, usVLCTableSize, ucBankNum, usOffset, enumOsdRotateType, _BURSTWRITE_FROM_FLASH);
}

